import React from 'react';
import {BrowserRouter as Router, Route} from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <Router>
      <Navbar>
        <Router path="/" exact component="{UserList}" />
      </Navbar>
    </Router>
  );
}

export default App;
